#include <stdio.h>

void findNumber(int* arr, int size, int number) {
    printf("Memory addresses and indices of number %d:\n", number);

    for (int i = 0; i < size; i++) {
        if (*(arr + i) == number) {
            printf("Memory Address: %p, Index: %d\n", (arr + i), i);
        }
    }
}

int main() {
    int size;

    printf("Enter the size of the array: ");
    scanf("%d", &size);

    int arr[size];

    printf("Enter elements of the array:\n");
    for (int i = 0; i < size; i++) {
        scanf("%d", &arr[i]);
    }

    int number;

    printf("Enter the number to find: ");
    scanf("%d", &number);

    findNumber(arr, size, number);

    return 0;
}

